import React, { useState, useEffect, useRef } from 'react';
import './MoodReport.css';

// Enhanced sample data with more metrics
const sampleReportData = {
    week: {
        streak: 5,
        journalEntries: 4,
        meditationMinutes: 35,
        moodDistribution: { 
            euphoric: 15, happy: 25, calm: 30, neutral: 15, anxious: 10, sad: 5 
        },
        dailyActivity: [3, 5, 2, 6, 4, 8, 5],
        biometrics: {
            avgHeartRate: 72,
            avgSleep: 6.5,
            hrv: 65,
            stressLevel: 42
        },
        moodTimeline: [
            { time: "08:00", mood: "calm", intensity: 0.7 },
            { time: "12:30", mood: "happy", intensity: 0.9 },
            { time: "15:45", mood: "anxious", intensity: 0.6 },
            { time: "19:20", mood: "calm", intensity: 0.8 },
            { time: "22:00", mood: "happy", intensity: 0.7 }
        ],
        insights: [
            "Your anxiety peaks around 3-4 PM. Try a 5-minute breathing exercise during this time.",
            "You're 34% more productive on days when you meditate for at least 10 minutes.",
            "Your sleep quality improves by 27% when you journal before bed."
        ],
        predictions: [
            { mood: "focused", probability: 0.85, time: "tomorrow 10:00" },
            { mood: "calm", probability: 0.78, time: "next 48 hours" }
        ],
        correlations: [
            { factor: "Sleep duration", impact: 0.76, effect: "mood stability" },
            { factor: "Caffeine after 2PM", impact: -0.63, effect: "sleep quality" },
            { factor: "Evening walk", impact: 0.82, effect: "next morning mood" }
        ]
    },
    month: {
        streak: 22,
        journalEntries: 18,
        meditationMinutes: 150,
        moodDistribution: { 
            euphoric: 10, happy: 25, calm: 25, neutral: 15, anxious: 20, sad: 5 
        },
        dailyActivity: [4, 6, 3, 7, 5, 9, 6],
        biometrics: {
            avgHeartRate: 70,
            avgSleep: 7.2,
            hrv: 72,
            stressLevel: 35
        },
        moodTimeline: [
            { time: "Week 1", mood: "calm", intensity: 0.6 },
            { time: "Week 2", mood: "happy", intensity: 0.8 },
            { time: "Week 3", mood: "anxious", intensity: 0.5 },
            { time: "Week 4", mood: "calm", intensity: 0.7 }
        ],
        insights: [
            "Your mood stability has improved by 42% compared to last month.",
            "Meditation consistency correlates with a 31% decrease in anxiety episodes.",
            "You're most creative on Tuesdays - schedule brainstorming sessions then."
        ],
        predictions: [
            { mood: "energetic", probability: 0.88, time: "next week" },
            { mood: "focused", probability: 0.79, time: "next 5 days" }
        ],
        correlations: [
            { factor: "Weekly exercise", impact: 0.81, effect: "stress reduction" },
            { factor: "Screen time after 9PM", impact: -0.72, effect: "sleep quality" },
            { factor: "Gratitude journaling", impact: 0.87, effect: "morning positivity" }
        ]
    }
};

function MoodReport({ user }) {
    const [timeRange, setTimeRange] = useState('week');
    const [reportData, setReportData] = useState(sampleReportData.week);
    const [activeTab, setActiveTab] = useState('overview');
    const [holographicMode, setHolographicMode] = useState(false);
    const canvasRef = useRef(null);

    useEffect(() => {
        setReportData(sampleReportData[timeRange]);
    }, [timeRange]);

    useEffect(() => {
        if (holographicMode && canvasRef.current) {
            const canvas = canvasRef.current;
            const ctx = canvas.getContext('2d');
            canvas.width = window.innerWidth;
            canvas.height = window.innerHeight;
            
            // Simple particle effect for holographic mode
            const particles = [];
            for (let i = 0; i < 100; i++) {
                particles.push({
                    x: Math.random() * canvas.width,
                    y: Math.random() * canvas.height,
                    radius: Math.random() * 2 + 1,
                    color: `hsl(${Math.random() * 60 + 180}, 100%, 80%)`,
                    speed: Math.random() * 2 + 0.5
                });
            }
            
            const animate = () => {
                ctx.clearRect(0, 0, canvas.width, canvas.height);
                particles.forEach(particle => {
                    ctx.beginPath();
                    ctx.arc(particle.x, particle.y, particle.radius, 0, Math.PI * 2);
                    ctx.fillStyle = particle.color;
                    ctx.fill();
                    
                    particle.y -= particle.speed;
                    if (particle.y < 0) {
                        particle.y = canvas.height;
                        particle.x = Math.random() * canvas.width;
                    }
                });
                
                if (holographicMode) requestAnimationFrame(animate);
            };
            
            animate();
            
            return () => {
                // Cleanup
            };
        }
    }, [holographicMode]);

    const moodColors = {
        euphoric: '#8A2BE2', // Vibrant purple
        happy: '#4CAF50',    // Green
        calm: '#2196F3',     // Blue
        neutral: '#FFC107',  // Amber
        anxious: '#FF5722',  // Deep orange
        sad: '#9C27B0'       // Purple
    };

    const generateConicGradient = (data) => {
        let gradient = '';
        let currentPercentage = 0;
        for (const mood in data) {
            if (data[mood] > 0) {
                const percentage = data[mood];
                gradient += `${moodColors[mood]} ${currentPercentage}% ${currentPercentage + percentage}%, `;
                currentPercentage += percentage;
            }
        }
        return gradient.slice(0, -2);
    };

    const maxActivity = Math.max(...reportData.dailyActivity, 0);

    // Calculate values for the radar chart
    const radarChartData = Object.keys(reportData.moodDistribution).map(mood => ({
        mood,
        value: reportData.moodDistribution[mood],
        fullMark: 100
    }));

    return (
        <div className={`report-hub tab-content ${holographicMode ? 'holographic-mode' : ''}`}>
            {holographicMode && <canvas ref={canvasRef} className="holographic-canvas"></canvas>}
            
            <div className="report-header">
                <h2>
                    <span className="futuristic-title">NEURO-ANALYTICS DASHBOARD</span>
                    <span className="subtitle">Advanced Mood Intelligence Platform</span>
                </h2>
                <div className="controls">
                    <div className="time-filter">
                        <button className={timeRange === 'week' ? 'active futuristic-btn' : 'futuristic-btn'} 
                                onClick={() => setTimeRange('week')}>
                            <span className="btn-icon">⏱️</span> This Week
                        </button>
                        <button className={timeRange === 'month' ? 'active futuristic-btn' : 'futuristic-btn'} 
                                onClick={() => setTimeRange('month')}>
                            <span className="btn-icon">📅</span> This Month
                        </button>
                    </div>
                    <button className={`holographic-toggle ${holographicMode ? 'active' : ''}`}
                            onClick={() => setHolographicMode(!holographicMode)}>
                        {holographicMode ? 'DISABLE HOLO' : 'ACTIVATE HOLO'}
                    </button>
                </div>
            </div>

            <div className="navigation-tabs">
                <button className={activeTab === 'overview' ? 'active' : ''} 
                        onClick={() => setActiveTab('overview')}>Overview</button>
                <button className={activeTab === 'biometrics' ? 'active' : ''} 
                        onClick={() => setActiveTab('biometrics')}>Biometrics</button>
                <button className={activeTab === 'patterns' ? 'active' : ''} 
                        onClick={() => setActiveTab('patterns')}>Patterns</button>
                <button className={activeTab === 'predictions' ? 'active' : ''} 
                        onClick={() => setActiveTab('predictions')}>Predictions</button>
            </div>

            {activeTab === 'overview' && (
                <>
                    <div className="report-stats-grid">
                        <div className="stat-card holographic">
                            <span className="stat-icon">🔥</span>
                            <span className="stat-value">{reportData.streak}</span>
                            <span className="stat-label">Day Streak</span>
                            <div className="progress-ring">
                                <svg viewBox="0 0 100 100">
                                    <circle className="progress-ring-circle" 
                                            stroke="#FF5722" 
                                            strokeWidth="8" 
                                            fill="transparent" 
                                            r="40" 
                                            cx="50" 
                                            cy="50"
                                            strokeDasharray={251.2}
                                            strokeDashoffset={251.2 - (reportData.streak/30 * 251.2)} />
                                </svg>
                            </div>
                        </div>
                        <div className="stat-card holographic">
                            <span className="stat-icon">📓</span>
                            <span className="stat-value">{reportData.journalEntries}</span>
                            <span className="stat-label">Journal Entries</span>
                            <div className="sparkline">
                                {reportData.dailyActivity.map((value, index) => (
                                    <div key={index} className="sparkline-bar" 
                                         style={{ height: `${(value / maxActivity) * 100}%` }}></div>
                                ))}
                            </div>
                        </div>
                        <div className="stat-card holographic">
                            <span className="stat-icon">🧘</span>
                            <span className="stat-value">{reportData.meditationMinutes}</span>
                            <span className="stat-label">Minutes Meditated</span>
                            <div className="circular-progress">
                                <div className="progress-text">{Math.round((reportData.meditationMinutes / (timeRange === 'week' ? 70 : 300)) * 100)}%</div>
                            </div>
                        </div>
                        <div className="stat-card holographic">
                            <span className="stat-icon">💓</span>
                            <span className="stat-value">{reportData.biometrics.avgHeartRate}</span>
                            <span className="stat-label">Avg BPM</span>
                            <div className="trend-indicator up">+2%</div>
                        </div>
                    </div>

                    <div className="report-charts-grid">
                        <div className="report-card holographic">
                            <h3>Mood Distribution</h3>
                            <div className="pie-chart-container">
                                <div className="pie-chart-3d">
                                    <div className="pie-chart" style={{ 
                                        background: `conic-gradient(${generateConicGradient(reportData.moodDistribution)})`,
                                        transform: 'perspective(500px) rotateX(60deg)'
                                    }}>
                                        <div className="pie-center">
                                            <span className="dominant-mood">
                                                {Object.entries(reportData.moodDistribution)
                                                    .reduce((a, b) => a[1] > b[1] ? a : b)[0]}
                                            </span>
                                        </div>
                                    </div>
                                </div>
                                <div className="chart-legend">
                                    {Object.keys(reportData.moodDistribution).map(mood => (
                                        <div key={mood} className="legend-item">
                                            <span className="color-dot" style={{ backgroundColor: moodColors[mood] }}></span>
                                            {mood.charAt(0).toUpperCase() + mood.slice(1)} ({reportData.moodDistribution[mood]}%)
                                        </div>
                                    ))}
                                </div>
                            </div>
                        </div>
                        
                        <div className="report-card holographic">
                            <h3>Activity Timeline</h3>
                            <div className="timeline-chart">
                                {reportData.dailyActivity.map((value, index) => (
                                    <div key={index} className="timeline-item">
                                        <div className="timeline-bar">
                                            <div className="timeline-fill" 
                                                 style={{ height: `${(value / maxActivity) * 100}%` }}>
                                                <div className="timeline-value">{value}</div>
                                            </div>
                                        </div>
                                        <span className="timeline-label">{['S', 'M', 'T', 'W', 'T', 'F', 'S'][index]}</span>
                                    </div>
                                ))}
                            </div>
                        </div>
                    </div>

                    <div className="report-charts-grid">
                        <div className="report-card holographic">
                            <h3>Mood Timeline</h3>
                            <div className="mood-timeline">
                                {reportData.moodTimeline.map((entry, index) => (
                                    <div key={index} className="timeline-point">
                                        <div className="timeline-marker" style={{ 
                                            backgroundColor: moodColors[entry.mood],
                                            boxShadow: `0 0 15px ${moodColors[entry.mood]}`
                                        }}></div>
                                        <div className="timeline-info">
                                            <span className="timeline-time">{entry.time}</span>
                                            <span className="timeline-mood">{entry.mood}</span>
                                        </div>
                                    </div>
                                ))}
                            </div>
                        </div>
                        
                        <div className="report-card holographic">
                            <h3>Biometric Correlation Matrix</h3>
                            <div className="correlation-matrix">
                                {reportData.correlations.map((correlation, index) => (
                                    <div key={index} className="correlation-item">
                                        <div className="factor-name">{correlation.factor}</div>
                                        <div className="factor-impact">
                                            <div className="impact-bar">
                                                <div className="impact-fill" style={{ 
                                                    width: `${Math.abs(correlation.impact) * 100}%`,
                                                    backgroundColor: correlation.impact > 0 ? '#4CAF50' : '#F44336'
                                                }}></div>
                                            </div>
                                            <span className="impact-value">{correlation.impact > 0 ? '+' : ''}{(correlation.impact * 100).toFixed(0)}%</span>
                                        </div>
                                        <div className="factor-effect">{correlation.effect}</div>
                                    </div>
                                ))}
                            </div>
                        </div>
                    </div>
                </>
            )}

            {activeTab === 'predictions' && (
                <div className="predictions-grid">
                    <div className="report-card holographic full-width">
                        <h3>Neuro-Predictive Analysis</h3>
                        <div className="predictions-container">
                            {reportData.predictions.map((prediction, index) => (
                                <div key={index} className="prediction-item">
                                    <div className="prediction-visual">
                                        <div className="probability-circle" 
                                             style={{ 
                                                 background: `conic-gradient(${moodColors[prediction.mood]} 0% ${prediction.probability * 100}%, #333 ${prediction.probability * 100}% 100%)`
                                             }}>
                                            <span className="probability-value">{(prediction.probability * 100).toFixed(0)}%</span>
                                        </div>
                                    </div>
                                    <div className="prediction-details">
                                        <h4 className="predicted-mood">{prediction.mood.toUpperCase()}</h4>
                                        <p className="prediction-time">Expected: {prediction.time}</p>
                                        <p className="prediction-confidence">Confidence: {(prediction.probability * 100).toFixed(1)}%</p>
                                    </div>
                                    <div className="prediction-actions">
                                        <button className="futuristic-btn small">PREPARE</button>
                                        <button className="futuristic-btn small">MITIGATE</button>
                                    </div>
                                </div>
                            ))}
                        </div>
                    </div>
                    
                    <div className="report-card holographic">
                        <h3>Intervention Recommendations</h3>
                        <div className="recommendations-list">
                            <div className="recommendation">
                                <span className="rec-icon">💡</span>
                                <div className="rec-content">
                                    <h4>Light Therapy Session</h4>
                                    <p>10 minutes at 7:30 AM based on your circadian rhythm</p>
                                </div>
                                <button className="futuristic-btn small">SCHEDULE</button>
                            </div>
                            <div className="recommendation">
                                <span className="rec-icon">🎵</span>
                                <div className="rec-content">
                                    <h4>Binaural Beats</h4>
                                    <p>Alpha waves for focus during your predicted slump tomorrow</p>
                                </div>
                                <button className="futuristic-btn small">PLAY</button>
                            </div>
                            <div className="recommendation">
                                <span className="rec-icon">🍽️</span>
                                <div className="rec-content">
                                    <h4>Nutrition Adjustment</h4>
                                    <p>Increase omega-3 intake to support mood stability</p>
                                </div>
                                <button className="futuristic-btn small">LEARN</button>
                            </div>
                        </div>
                    </div>
                </div>
            )}

            <div className="report-card ai-insights holographic">
                <h3>🧠 QUANTUM AI INSIGHTS</h3>
                <div className="insights-grid">
                    {reportData.insights.map((insight, index) => (
                        <div key={index} className="insight-item">
                            <div className="insight-icon">💡</div>
                            <p>{insight}</p>
                        </div>
                    ))}
                </div>
                <div className="ai-actions">
                    <button className="futuristic-btn">DEEP ANALYSIS</button>
                    <button className="futuristic-btn">EXPORT DATA</button>
                    <button className="futuristic-btn">SHARE WITH THERAPIST</button>
                </div>
            </div>
        </div>
    );
}

export default Report;
